"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[1527],{4316:(e,l,t)=>{t.r(l),t.d(l,{default:()=>o});const a=(0,t(6252).uE)('<h1 id="pull-request-labelling" tabindex="-1"><a class="header-anchor" href="#pull-request-labelling" aria-hidden="true">#</a> Pull Request Labelling</h1><p>When you open a Pull Request, two labels will be automatically applied for you:</p><ul><li>A label indicating the size of the PR, based on lines changed</li><li>A label indicating the type of PR, based on the branch you&#39;re asking to merge from</li></ul><p>In addition, you <strong>must</strong> add the following labels if appropriate:</p><ul><li><code>critical</code> if the PR must be addressed urgently</li><li><code>sanity-check</code> if the code included in this PR has already been reviewed <ul><li>e.g. An <code>epic/* -&gt; develop</code> PR</li></ul></li><li><code>deployment</code> if this PR will upload a new production build <ul><li>Should only be used on <code>release/* -&gt; master</code> PRs</li></ul></li></ul><p>Additionally, if you have started to review a large PR, you can add an <code>in-progress</code> label to ensure someone else doesn&#39;t also start a review.</p>',6),i={},o=(0,t(3744).Z)(i,[["render",function(e,l){return a}]])},3744:(e,l)=>{l.Z=(e,l)=>{for(const[t,a]of l)e[t]=a;return e}},7741:(e,l,t)=>{t.r(l),t.d(l,{data:()=>a});const a={key:"v-67bfbd0d",path:"/android/pull-request-labels.html",title:"Pull Request Labelling",lang:"en-US",frontmatter:{},excerpt:"",headers:[],filePathRelative:"android/pull-request-labels.md",git:{updatedTime:1650377534e3,contributors:[{name:"Peter Bryant",email:"peter.bryant@netsells.co.uk",commits:1}]}}}}]);